import React from 'react';
import { Flex } from '../@commons/Flex/Flex';
import { Form } from '../@commons/Form/Form';

const RpcGame = () => {
  return (
    <>
      <Flex flex-direction='column'>
        <p>가위바위보 그림</p>
        <Form>
          <button>가위</button>
          <button>바위</button>
          <button>보</button>
        </Form>
        <Flex>
          <p>나의 선택</p>
          <p>결과 메시지</p>
          <p>현재점수 : 10 점</p>
        </Flex>
      </Flex>
    </>
  );
};

export default RpcGame;
